import request from '@/utils/request';
export function getBook() {
  return request({
    url: '/uschool/book',
    method: 'get'
  });
}
export function getCode() {
  return request({
    url: '/uschool/code',
    method: 'get'
  });
}
export function getSchedule(params) {
  return request({
    url: '/uschool/schedule',
    method: 'get',
    params: params
  });
}
export function makeQuestion(params) {
  return request({
    url: '/uschool/make_question',
    method: 'post',
    params: params
  });
}
export function getTask() {
  return request({
    url: '/uschool/task',
    method: 'get'
  });
}
